import React, { useState } from "react";

export default function App() {
  const [reports, setReports] = useState([]);
  function getAllReports() {
    const API_URL_Report = "https://localhost:7225/api/Report/GetAllReports";
    fetch(API_URL_Report, {
      method: "GET",
    })
      .then((response) => response.json())
      .then((reportsFromServer) => {
        console.log(reportsFromServer);
        setReports(reportsFromServer);
      })
      .catch((error) => {
        console.log(error);
        alert(error);
      });
  }
  return (
    <div className="container">
      <div className="row min-vh-100">
        <div className="col d-flex flex-column justify-content-center align-items-center">
          <div>
            <h1>Scout Reports</h1>
            <div className="mt-5"></div>
            <button onClick={getAllReports} className="btn btn-dark btn-lg">Get All Reports</button>
            <button onClick={()=>{}} className="btn btn-dark btn-lg mt-4">Get All Players</button>
            </div>
          {reports.length > 0 && renderReportTable()}
        </div>
      </div>
    </div>
  );

  function renderReportTable() {
    return (
      <div className="table-responsive mt-5">
        <table className="table table-bordered border-dark">
          <thead>
            <tr>
              <th scope="col">ReportId</th>
              <th scope="col">Player Key</th>
              <th scope="col">First Name</th>
              <th scope="col">Last Name</th>
              <th scope="col">Shooting Rating</th>
              <th scope="col">Assist Rating</th>
              <th scope="col">Rebound Rating</th>
              <th scope="col">Defense Rating</th>
              <th scope="col">Highlight</th>
              <th scope="col">Update/Delete</th>
            </tr>
          </thead>
          <tbody>
           {reports.map((report) =>{
            <tr key={report.ReportId}>
              <th scope="row">{report.ReportId}</th>
              <td>{report.PlayerKey}</td>
              <td>{report.FirstName}</td>
              <td>{report.LastName}</td>
              <td>{report.ShootingRating}</td>
              <td>{report.AssistRating}</td>
              <td>{report.ReboundRating}</td>
              <td>{report.DefenseRating}</td>
              <td>{report.HighlightLink}</td>
              <td>
                <button className="btn btn-dark btn-lg">Update</button>
                <button className="btn btn-danger btn-lg">Delete</button>
              </td>
            </tr>

           })}
          </tbody>
        </table>

      </div>
    );
  }
}
